import { Card, Typography } from "@mui/material";
import React from "react";

const QuestionCreator = () => {
  return (
    <Card>
      <Typography sx={{ mb: 2.5, fontWeight: 500 }}>Question</Typography>
    </Card>
  );
};

export default QuestionCreator;
